import React from "react";
import Post from "./Post";
import Loader from "./Loader";

const PostsList = posts => {
  return (
    <div>
      {!posts ? (
        <Loader />
      ) : (
        <ul>
          {posts.map(post => (
            <Post />
          ))}
        </ul>
      )}
    </div>
  );
};

export default PostsList;
